import React from 'react';
import './whattsappCall.css'
const  WhatSappCall = () => {
  // Define your state variables for form fields
  const [fullName, setFullName] = React.useState('');
  const [city, setCity] = React.useState('Casablanca');
  const [phone, setPhone] = React.useState('');
  const [email, setEmail] = React.useState('');
  const [theme, setTheme] = React.useState('');

  // Define functions to handle form submission and field changes
  const handleSubmit = (event) => {
    event.preventDefault();
    // Perform form submission logic here
  };

  return (
    <div id="divFormCall" className="div-block-234" style={{ display: 'block' }}>
      <div className="div-block-269">
        <div className="div-block-235" style={{ backgroundColor: '#0d923e' }}>
          <img style={{ marginRight: '18px' }} src="assistance.png" loading="lazy" width="78" alt="" className="image-112" />
          <div className="text-block-163">Discutez avec un agent</div>
          <div id="btnFormCallClose" className="div-block-237">
            <img src="arrow-down-sign-to-navigate-1.png" loading="lazy" width="11" alt="" />
          </div>
        </div>
        <div className="div-block-247">
          <div className="form-block-3 w-form">
            <form id="formCallMe" name="email-form-2" data-name="Email Form 2" onSubmit={handleSubmit} className="form-4" aria-label="Email Form 2">
              <label htmlFor="fullName" className="field-label">Nom &amp; prénom</label>
              <input type="text" className="text-field-6 w-input" autoComplete="off" maxLength="256" name="name" data-name="Name" placeholder="Entrer votre nom" id="fullName" value={fullName} onChange={(e) => setFullName(e.target.value)} required />

              <label htmlFor="city" className="field-label">Ville</label>
              <select id="city" name="field-2" data-name="Field 2" className="text-field-6 w-select" value={city} onChange={(e) => setCity(e.target.value)} required>
                <option value="Casablanca">Casablanca</option>
                <option value="Rabat">Rabat</option>
                <option value="Marrakech">Marrakech</option>
                <option value="autre">Autre ville</option>
              </select>

              <label htmlFor="phone" className="field-label">Tél.</label>
              <input type="text" className="text-field-6 w-input" autoComplete="off" maxLength="256" name="name-2" data-name="Name 2" placeholder="Entrer votre téléphone" id="phone" value={phone} onChange={(e) => setPhone(e.target.value)} required />

              <label htmlFor="email" className="field-label">Email</label>
              <input type="text" className="text-field-6 w-input" autoComplete="off" maxLength="256" name="name-2" data-name="Name 2" placeholder="Entrer votre adresse email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} required />

              <label htmlFor="theme" className="field-label">Description</label>
              <textarea style={{}} className="text-field-6 w-input" autoComplete="off" maxLength="256" name="theme" data-name="theme" placeholder="Décrivez votre problème" id="theme" style={{ height: '100px', resize: 'vertical' }} value={theme} onChange={(e) => setTheme(e.target.value)} required></textarea>

              <div className="div-block-236">
                <button type="submit" id="btnCallMe" style={{ backgroundColor: '#0d923e', color: 'white' }} className="button-20 w-button">
                  <span className="whatsapp-icon"></span>
                  Discutez avec moi !
                </button>
              </div>
            </form>
            <div className="success-message-4 w-form-done" tabIndex="-1" role="region" aria-label="Email Form 2 success">
              <div>Merci, votre demande a bien été envoyée</div>
            </div>
            <div className="error-message-7 w-form-fail" tabIndex="-1" role="region" aria-label="Email Form 2 failure">
              <div>Merci, votre demande a bien été envoyée et sera traitée dans les plus brefs délais.</div>
            </div>
          </div>
          <div id="messageRappel" className="div-block-279">
            <div className="text-block-177">Votre demande de rappel a bien été envoyée !</div>
          </div>
        </div>
      </div>
    </div>
  );

};
export default WhatSappCall;
